$(function () {
  $('.js-scrollLink').on("click", function () {
    var speed = 500;
    var spheaderH = 78; //SP

    var pcheaderH = 78; //PC

    var href = $(this).attr("href");
    var target = $(href == "#" || href == "" ? "html" : href);
    var spposition = target.offset().top - spheaderH;
    var pcposition = target.offset().top - pcheaderH;

    if (window.matchMedia("(max-width: 767px)").matches) {
      $("html, body").animate({
        scrollTop: spposition
      }, speed, "swing");
      return false;
    } else {
      $("html, body").animate({
        scrollTop: pcposition
      }, speed, "swing");
      return false;
    }
  });

  var topBtn = $("#js-floatNav"),
      firstDunationBtn = $("#js-dunationBtn"),
  thisOffset = $('#js-secondView').offset().top + $('#js-secondView').outerHeight();
	topBtn.hide();
	jQuery(window).on("scroll", function () {
     //セカンドビューから表示
		if ($(window).scrollTop() + $(window).height() > thisOffset) {
      firstDunationBtn.fadeOut('1500');
			topBtn.fadeIn();
		} else {
      firstDunationBtn.fadeIn('1500');
			topBtn.fadeOut();
		}
	});


  //グローバルメニュー開閉
  $(".js-pcToggle").on("click", function () {
    $(".js-pcToggle").toggleClass("is-active");
    $("html").toggleClass("is-fixed");
    $("#js-pcNav").fadeToggle();
    if ($(this).hasClass("is-active")) {
      $(".js-toggleText").text("閉じる");
    } else {
      $(".js-toggleText").text("全て見る");
    }
  });

  //グローバルメニューSPアコーディオン
  var parentNav = jQuery(".js-parentNav"),
      childNav  = jQuery(".js-childNav");
  childNav.hide();
	parentNav.on("click",function() {
		parentNav.removeClass("is-active");
		var contents = jQuery(this).next(".js-childNav");
		if (contents.is(":visible")) {
			contents.slideUp("slow");
			jQuery(this).removeClass("is-active");
		} else {
			childNav.slideUp("slow");
			contents.slideDown("slow");
			jQuery(this).addClass("is-active");
		}
		return false;
	});

    // newsのアコーディオン動作
    $('.articletag__btn').on('click', function(){
        $(this).toggleClass('is-active');
        $(this).next().slideToggle();
    })

  //ウラ話
  $('.js-module20Bverse').on("click", function() {
      $(this).parents('.c-module20__entry-bverse').addClass("is-hide").removeClass("is-show");
      $(this).parents('.c-module20__entry-bverse').next('.c-module20__entry-reverse').removeClass("is-hide").addClass("is-show");
      return false;
  });
  $('.js-module20Reverse').on("click", function() {
      $(this).parents('.c-module20__entry-reverse').addClass("is-hide").removeClass("is-show");
      $(this).parents('.c-module20__entry-reverse').prev('.c-module20__entry-bverse').removeClass("is-hide").addClass("is-show");
      return false;
  });
});